import React from "react";
import Accordion from "react-bootstrap/Accordion";
import "./ViewList.css";

const ViewList = (props) => {
  return (
    <>
      <div className="container">
        <div className="row">
          <div className="d-flex">
            <div className="col-5">
              {props.items.map((obj) => (
                <Accordion key={obj.id} className="list">
                  <Accordion.Item>
                    <Accordion.Header>{obj.name}</Accordion.Header>
                    <Accordion.Body>
                      <ul>
                        <li>
                          <p>{obj.email}</p>
                        </li>
                        <li>
                          <p>{obj.age}</p>
                        </li>
                        <li>
                          <p>{obj.amountDonate + "$"}</p>
                        </li>
                      </ul>
                    </Accordion.Body>
                  </Accordion.Item>
                </Accordion>
              ))}
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default ViewList;
